import React from "react";
import "./Dialogs.css"
import Dialog from "./Dialog/Dialog";

function Dialogs(){
    return(
        <div className="dialogs"> 
        <button className="otpravka">
        <img src="data:image/svg+xml;base64," />
        </button>
        <Dialog name={Владимир}/>
        </div>
    )
}

export default Dialogs
